import { useEffect, useState } from "react";

function PokemonView() {
  const [allPokemons, setAllPokemons] = useState([]);

  useEffect(() => {
    setAllPokemons([1, 2, 3]);
    console.log(allPokemons);
  }, []);

  return (
    <div>
      {allPokemons.map((pokemon) => (
        <p>{pokemon}</p>
      ))}
    </div>
  );
}

export default PokemonView;
